// src/components/HeroSection.js
import React from "react";
import "./HeroSection.css"; // For styling

function HeroSection() {
  return (
    <section className="hero">
      <h1>stonks</h1>
      <p>Stonks ($STNK) is the first memecoin on Solana. There is no second first.</p>
      <button className="buy-button">Buy $STNK</button>
      <div className="social-icons">
        <a href="https://coinmarketcap.com" target="_blank" rel="noopener noreferrer">
          <img src="/assets/coinmarketcap.png" alt="CoinMarketCap" />
        </a>
        <a href="https://coingecko.com" target="_blank" rel="noopener noreferrer">
          <img src="/assets/coingecko.png" alt="CoinGecko" />
        </a>
      </div>
    </section>
  );
}

export default HeroSection;
